-- | Returns the 'IdentifierType's corresponding to a character.
{-# INLINE identifierTypes #-}
identifierTypes :: Char -> Int
identifierTypes c
    -- Planes 0-3
    | cp < 0x323B0 = lookupIdentifierTypesBitMap cp
    -- Planes 4-13: 0
    | cp < 0xE0000 = 0
    -- Plane 14
    | cp < 0xE01F0 = lookupIdentifierTypesBitMap (cp - 0xADC50)
    -- Default: 0
    | otherwise = 0
    where
    cp = ord c

